import React from 'react'

export const Header = ({ handleLogout }) => {
    return (
        <>
        <h2>
            Family Budget Planner
        </h2>
        <div >
        <button style={{position: 'absolute',top: '10px',right: '10px' }} onClick={handleLogout}>logout</button>
        </div>
        </>
    )
}
